tables.table_schema:
CREATE TABLE Feedback (
    feedback_id INT PRIMARY KEY,
    listener_id INT,
    feedback_message TEXT,
    rating INT
);

CREATE TABLE Comments (
    comment_id INT PRIMARY KEY,
    feedback_id INT,
    commenter_id INT,
    comment_text TEXT
);

CREATE TABLE feedback (
    feedback_id UUID PRIMARY KEY,
    listener_name VARCHAR(255),
    feedback_text TEXT,
    timestamp TIMESTAMP
);

CREATE TABLE customer_concerns (
    concern_id UUID PRIMARY KEY,
    customer_name VARCHAR(255),
    concern_text TEXT,
    resolution TEXT
);
